import React from 'react'
import {Link} from 'react-router-dom'
import "./Navbar.css"
import Darkmod from './Darkmod'
import {useState} from 'react';

function Navbar() {

    const [showLinks, setShowLinks] = useState(false)

    const handleShowLinks = () => {
        setShowLinks(!showLinks)
    }
    return (   

        <div className={`navbar ${showLinks ? "show-nav navbar" : "hide-nav navbar"} `}>
            <ul className="navbar_links">
            <Link to="/" className="navbar_link navbar_item slideInDown-1 link">INFOS</Link>
            <Link to="/graphiques"className="navbar_link navbar_item slideInDown-2 link">GRAPHIQUES</Link>
            <Link to="/centres" className="navbar_link navbar_item slideInDown-3 link">CENTRES DE VACCINATION</Link>
            <Link to="/quizz"className="navbar_link navbar_item slideInDown-4 link" target="_blank">QUIZZ</Link>
            <Darkmod/>
            /ul></ul>
        <button className="navbar_burger" onClick = {handleShowLinks}>
            <span className="burger-bar"></span>
        </button>

       </div>

    )
}

export default Navbar
